import registerFlightReducer from "./registerFlightReducer";
import deleteFlightReducer from "./deleteFlightReducer";
import { combineReducers } from "redux";

const rootReducers = combineReducers({
  register: registerFlightReducer,
  delete: deleteFlightReducer
});

export default rootReducers;
